script: |
  super -f text -I q2749.spq | sort > q2749.out

inputs:
  - name: q2749.spq
    data: |
      SELECT - ( - col2 ) * + col1 + - + col0 + - - 14 * col1 / + col1 + 83 - - col0 AS col1, 90 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q2749.out
    data: |
      196	90
      307	90
      3904	90
